import React from "react";
import { FaClock, FaArrowRight } from "react-icons/fa";
import "../cs/App.css"; // or your preferred CSS file

function StaffDashboard() {
  return (
    <div className="staff-dashboard">
      <div className="dashboard-card">
        <h2 className="dashboard-title">Welcome<br />Back</h2>

        <button className="dashboard-btn time-in">
          <FaClock className="icon" /> Time – In
        </button>

        <button className="dashboard-btn check-out">
          <FaArrowRight className="icon" /> Check – Out
        </button>
      </div>
    </div>
  );
}

export default StaffDashboard;
